import React, { useEffect, useState } from "react";
import { CircularProgress, Switch } from "@mui/material";
import { GrEdit } from "react-icons/gr";
import { FiEdit } from "react-icons/fi";
import { Line, Circle } from "rc-progress";

const BinanceTable = ({ item, handleChange, handelEditModal }) => {
  const indicatior = item.buying_restriction_limit > item.grid_quantity;
  console.log(indicatior, "indicator");

  const progg = 1 - (item.current_price / item.reference_price) * 100;
  console.log(progg, "pppp");

  const [progress, setProgress] = useState(0);

  useEffect(() => {
    // Simulate progress update
    const interval = setInterval(() => {
      setProgress((prevProgress) =>
        prevProgress >= 100 ? 0 : prevProgress + 10
      );
    }, 1000);

    return () => clearInterval(interval);
  }, []);

  let indication = 3;
  return (
    <div
      style={{
        height: "50%",
        width: "75%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: 275,
          width: "90%",
          background: "white",
          borderRadius: 10,
          display: "flex",
          boxShadow:
            "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
        }}
      >
        <div
          style={{
            height: "100%",
            width: "50%",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <div
            style={{
              height: "95%",
              width: "95%",
              background: "white",
              display: "flex",
            }}
          >
            <div
              style={{
                width: "50%",
                height: "100%",
                display: "flex",
                flexDirection: "column",
                justifyContent: "space-around",
                gap: 5,
                marginLeft: 20,
              }}
            >
              <p style={{ fontWeight: "bold", fontSize: 16 }}>COIN NAME</p>
              <p style={{ fontWeight: "bold", fontSize: 16 }}>BUYING AMOUNT</p>
              <p style={{ fontWeight: "bold", fontSize: 16 }}>SELLING AMOUNT</p>
              <p style={{ fontWeight: "bold", fontSize: 16 }}>GRID AMOUNT</p>
              <p style={{ fontWeight: "bold", fontSize: 16 }}>GRID QUANTITY</p>
              <p style={{ fontWeight: "bold", fontSize: 16 }}>CURRENT PRICE</p>
            </div>
            <div
              style={{
                width: "50%",
                height: "100%",
                display: "flex",
                flexDirection: "column",
                justifyContent: "center",
              }}
            >
              <div
                style={{
                  width: "80%",
                  height: "95%",
                  display: "flex",
                  flexDirection: "column",
                  alignItems: "center",
                  justifyContent: "space-around",
                  gap: 5,
                  borderRadius: 20,
                }}
              >
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    color: "red",
                    fontWeight: "bold",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {item.name}
                </p>
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {item.buying_amount.toFixed(4)}
                </p>
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {item.selling_amount.toFixed(4)}
                </p>
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {item.grid_amount.toFixed(4)}
                </p>
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {item.grid_quantity.toFixed(4)}
                </p>
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {item.current_price.toFixed(4)}
                </p>
              </div>
            </div>
          </div>
        </div>
        <div
          style={{
            height: "100%",
            width: "50%",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <div
            style={{
              height: "95%",
              width: "95%",
              background: "white",
              display: "flex",
            }}
          >
            <div
              style={{
                width: "50%",
                height: "100%",
                display: "flex",
                flexDirection: "column",
                justifyContent: "space-around",
                gap: 5,
                textAlign: "left",
              }}
            >
              <p style={{ fontWeight: "bold", fontSize: 16 }}>AUTO BUYING</p>
              <p style={{ fontWeight: "bold", fontSize: 16 }}>AUTO SELLING</p>
              <p style={{ fontWeight: "bold", fontSize: 16 }}>
                REFERENCE PRICE
              </p>
              <p style={{ fontWeight: "bold", fontSize: 16 }}>
                DESTINATION PRICE
              </p>
              <p style={{ fontWeight: "bold", fontSize: 16 }}>
                BUYING RESTRICTION LIMIT
              </p>
            </div>
            <div
              style={{
                width: "50%",
                height: "100%",
                display: "flex",
                flexDirection: "column",
                justifyContent: "center",
              }}
            >
              <div
                style={{
                  width: "80%",
                  height: "95%",
                  display: "flex",
                  flexDirection: "column",
                  alignItems: "center",
                  justifyContent: "space-around",
                  gap: 5,
                  borderRadius: 20,
                }}
              >
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {
                    <Switch
                      onChange={() => handleChange()}
                      checked={item.auto_buying}
                    />
                  }
                </p>
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {
                    <Switch
                      onChange={() => handleChange()}
                      checked={item.auto_selling}
                    />
                  }
                </p>
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {item.reference_price.toFixed(7)}
                </p>
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {item.destination_price.toFixed(7)}
                </p>
                <p
                  style={{
                    width: "100%",
                    height: "20%",
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    boxShadow:
                      "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                  }}
                >
                  {item.buying_restriction_limit.toFixed(4)}
                </p>
              </div>
            </div>
          </div>
        </div>
        <div>
          <div
            style={{
              height: 30,
              width: 30,
              borderRadius: 15,
              marginTop: 10,
              marginRight: 10,
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              cursor: "pointer",
              background: "gray",
            }}
            onClick={() => handelEditModal(item)}
          >
            <FiEdit style={{ color: "white" }} />
          </div>
          {indicatior ? (
            <div
              style={{
                height: 30,
                width: 30,
                borderRadius: 15,
                marginTop: 20,
                background: "red",
              }}
            ></div>
          ) : (
            <div
              style={{
                height: 30,
                width: 30,
                borderRadius: 15,
                marginTop: 20,
                background: "green",
              }}
            ></div>
          )}
          {<CircularProgress percentage={progress} />}
          <div></div>
        </div>
      </div>
    </div>
  );
};

export default BinanceTable;
